(function(){tinymce.PluginManager.requireLangPack("youtube");tinymce.create("tinymce.plugins.youtubePlugin",{init:function(a,b){a.addCommand("mceyoutube",function(){a.windowManager.open({file:b+"/youtube.htm",width:320+parseInt(a.getLang("youtube.delta_width",0)),height:120+parseInt(a.getLang("youtube.delta_height",0)),inline:1},{plugin_url:b,some_custom_arg:"custom arg"})});a.addButton("youtube",{title:"youtube.desc",cmd:"mceyoutube",image:b+"/img/youtube.gif"});a.onNodeChange.add(function(d,c,e){c.setActive("youtube",e.nodeName=="IMG")})},createControl:function(b,a){return null},getInfo:function(){return{longname:"youtube plugin",author:"Some author",authorurl:"http://tinymce.moxiecode.com",infourl:"http://wiki.moxiecode.com/index.php/TinyMCE:Plugins/youtube",version:"1.0"}}});tinymce.PluginManager.add("youtube",tinymce.plugins.youtubePlugin)})();